script: |
  super -f text -I q6773.spq | sort > q6773.out

inputs:
  - name: q6773.spq
    data: |
      SELECT - 85 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE + ( 60 ) * + col1 NOT BETWEEN NULL AND ( 25 ) - col1;
  - name: tab2

outputs:
  - name: q6773.out
    data: |
      -85
      -85
      -85
